import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var Sidebar = createReactComponent("Sidebar", ["svg", defaultAttributes, [["rect", {
  x: "3",
  y: "3",
  width: "18",
  height: "18",
  rx: "2",
  ry: "2",
  key: "1sylwi"
}], ["line", {
  x1: "9",
  y1: "3",
  x2: "9",
  y2: "21",
  key: "5od17k"
}]]]);
export default Sidebar;
